INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "", 0, 1, 40000, "", 36, 100, 8, 0, 91002);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "ぺコリーヌ", 107501, 1, 40001, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 37, 150, 8, 1, 91002);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "コッコロ", 107601, 2, 40001, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 38, 150, 8, 1, 91002);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "キャル", 107801, 3, 40001, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 39, 150, 8, 1, 91002);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "スズメ", 107701, 4, 40001, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 40, 150, 8, 1, 91002);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "タマキ", 107901, 5, 40001, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 41, 150, 8, 1, 91002);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "ぺコリーヌ", 107501, 6, 40001, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 42, 150, 8, 2, 91002);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "コッコロ", 107601, 7, 40001, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 43, 150, 8, 2, 91002);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "キャル", 107801, 8, 40001, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 44, 150, 8, 2, 91002);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "スズメ", 107701, 9, 40001, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 45, 150, 8, 2, 91002);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "タマキ", 107901, 10, 40001, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 46, 150, 8, 2, 91002);
