INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "リリ", 125801, 1, 40011, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 321, 1, 2, 1, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "クリア", 126001, 2, 40011, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 322, 1, 2, 1, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "プレシア", 126101, 3, 40011, "んーと。\nこれ、あげる。\nはい", 323, 1, 2, 1, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "リリ", 125801, 4, 40011, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 324, 1, 2, 2, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "クリア", 126001, 5, 40011, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 325, 1, 2, 2, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "プレシア", 126101, 6, 40011, "お兄。\nきてくれて、うれしい", 326, 1, 2, 2, 24001);
